<div class="entities" style="line-height: 2.5; direction: ltr">Histone deacetylase inhibitors increase microRNA - 146a expression and enhance negative regulation of interleukin - 1β signaling in osteoarthritis fibroblast-like synoviocytes . OBJECTIVE : MiR - 146a exerts negative control on inflammatory responses by suppressing cytokine-induced expression of interleukin - 1 receptor-associated kinase - 1 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P51617
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) and tumor necrosis factor receptor-associated factor 6 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9Y4K3
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) by impairing NF-κB activity and inhibiting the expression of target genes . Recent study suggests that histone deacetylases ( HDACs ) are involved in the regulation of microRNA ( miRNA ) expression . Therefore , we determined whether HDAC inhibitors can increase miR - 146a expression , thereby inhibiting interleukin - 1β ( IL - 1β ) - induced signaling in osteoarthritis fibroblast-like synoviocytes ( OA-FLS ) . METHOD : MiRNA expression was analyzed using real-time PCR . IL - 1β - induced downstream signals and cytokine expression were evaluated using Western blotting and ELISA . Transcription factors regulating promoter activation were identified using chromatin immunoprecipitation assays . RESULTS : IL - 1β treatment of OA-FLS induced a mild ( 1.7- fold ) increase in miR - 146a expression that was unable to appropriately downregulate 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P51617
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q9Y4K3
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 and ku80 null mutants improve the gene targeting frequency in Monascus ruber M7 . Normally , gene targeting by homologous recombination occurs rarely during a transformation process since non-homologous recombination is predominant in filamentous fungi . In our previous researches , the average gene replacement frequency ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) in Monascus ruber M7 was as low as 15 % . To develop a highly efficient gene targeting system for M . ruber M7 , two M . ruber M7 null mutants of ku70 ( MrΔku 70 ) and ku80 ( MrΔku 80 ) were constructed which had no apparent defects in the development including vegetative growth , colony phenotype , microscopic morphology and spore yield compared with M . ruber M7 . In addition , the production of some significant secondary metabolites such as pigments and citrinin had no differences between the two disruptants and the wild-type strain . Further results revealed that the GRFs of triA ( encoding a putative acetyltransferase ) were 42.2 % and 61.5 % in the MrΔku 70 and MrΔku 80 strains , respectively , while it was only about 20 % in M . ruber M7 . Furthermore , GRFs of these two disruptants at other loci ( the pigE , fmdS genes in MrΔku 70 and the ku70 gene in MrΔku 80 ) were investigated , and the results indicated that GRFs in the MrΔku 70 strain and the MrΔku 80 strain were doubled and tripled compared with that in M . ruber M7 , respectively . Therefore , the ku70 and ku80 null mutants of M . ruber M7 , especially the ku80 - deleted strain , will be excellent hosts for efficient gene targeting .</div>
